    "The Evolution of Patuxent as a Research Refuge and a Wildlife Research Center",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-07-27T22:58:08.576945",nt"name": "the-evolution-of-patuxent-as-a-research-refuge-and-a-wildlife-research-center",nt"isopen":
    false,nt"url": null,nt"notes": "The following is a discussion of the evolution
    of Patuxent over 60 years and is divided into three major periods in this paper,
    (1) Wildlife Conservation, (2) Environmental Movement, and (3) Public Outreach.
    The formation of Patuxent took place essentially during the birth of wildlife conservation
    in the United States. The original mission, to assist in the restoration of wildlife,
    led administrators and researchers to focus on land management research during the
    1940s and 1950s. During the 1960-70s, Patuxent was influenced by the nationwide
    environmental movement and became renowned through studies to evaluate the effects
    of pesticides on birds and research on endangered species of wildlife. The 1980-90s
    saw a shift in emphasis from research studies to increasing activities with public
    use, environmental education, and refuge management. Highlights of this evolution
    are discussed in this paper.",nt"license_title": "License Not Specified",nt"extras":
